import React from "react";
import { useSelector } from "react-redux";
import "../App.css";

export const Canvas = ({height, width}) => {
    return (
        <div className="canvas" style={{height:`${height}px`, width: `${width}px`}}>
            i'm canvas
        </div>
    );
}
